   "source": [
    "## Introduction\n",
    "\n",
    "This is my attempt in training a GAM binary classification model in R for predicting whether there are software defects in the code. I will be using the `bam` function from the `mgcv` library, which enables reasonably fast training of additive models on large datasets."
   ]
  },
