   "source": [
    "We now check if there is any feature for which its mode has more than 90% of the observations. It is unlikely that any model can reliably use such features. So, we will drop them."
   ]
  },
  {
   "cell_type": "code",
   "execution_count": 6,
   "id": "325c614a",
   "metadata": {
    "execution": {
     "iopub.execute_input": "2023-10-11T18:06:53.609596Z",
     "iopub.status.busy": "2023-10-11T18:06:53.608471Z",
     "iopub.status.idle": "2023-10-11T18:06:55.174746Z",
     "shell.execute_reply": "2023-10-11T18:06:55.173411Z"
    },
    "papermill": {
     "duration": 1.576722,
     "end_time": "2023-10-11T18:06:55.177143",
     "exception": false,
     "start_time": "2023-10-11T18:06:53.600421",
     "status": "completed"
    },
    "tags": []
   },
   "outputs": [
    {
     "name": "stdout",
     "output_type": "stream",
     "text": [
      "Columns where the most common value occurs in more than 90% of the observation.\n",
      "These columns will be removed.\n",
      "\n",
      "locCodeAndComment \n",
      "        0.9192929 \n"
     ]
    }
   ],
   "source": [
    "# Define a function to calculate the mode fraction\n",
    "get_mode_fraction <- function(x) {\n",
    "  cts <- table(x)\n",
    "  return(max(cts) / length(x))\n",
    "}\n",
    "\n",
    "# Define a function to filter elements greater than a threshold\n",
    "filter_greater_than <- function(series, threshold) {\n",
    "  return(series[series > threshold])\n",
    "}\n",
    "\n",
    "# Calculate mode fraction and \n",
    "high_mode_per <- train %>%\n",
    "  select(-defects) %>%\n",
    "  sapply(get_mode_fraction) %>%\n",
    "  filter_greater_than(threshold = 0.9)\n",
    "\n",
    "cat('Columns where the most common value occurs in more than 90% of the observation.\\n')\n",
    "cat('These columns will be removed.\\n\\n')\n",
    "print(high_mode_per)\n",
    "\n",
    "# filter columns with high mode fraction\n",
    "train <- train %>% select(-any_of(names(high_mode_per)))"
   ]
  },
