   "source": [
    "options(repr.plot.width = 12, repr.plot.height = 9)\n",
    "train %>% \n",
    "    gather(key = \"column\", value = \"value\", -defects) %>%\n",
    "    mutate(column = factor(column, levels = colnames(train %>% select(-\"defects\")))) %>%\n",
    "    ggplot(mapping = aes(x = value)) + \n",
    "        geom_histogram(bins = 15) + \n",
    "        facet_wrap( ~ column, scales='free', ncol = 5) +\n",
    "        xlab('') + ylab('')"
   ]
