   "source": [
    "# correlation matrix\n",
    "corr_matrix <- cor(train %>% select(-\"defects\"), method = \"spearman\")\n",
    "\n",
    "# compute the dissimilarity or distance matrix\n",
    "dist_matrix <- 1 - abs(corr_matrix)"
   ]
  },
