   "source": [
    "We will now generate the cluster labels for each feature. The number of clusters will depend on the distance threshold. For smaller distance thresholds, more clusters will be formed. Here, we use a distance threshold of 0.2"
   ]
  },
  {
   "cell_type": "code",
   "execution_count": 12,
   "id": "0f10e708",
   "metadata": {
    "execution": {
     "iopub.execute_input": "2023-10-11T18:07:00.363414Z",
     "iopub.status.busy": "2023-10-11T18:07:00.362265Z",
     "iopub.status.idle": "2023-10-11T18:07:00.384034Z",
     "shell.execute_reply": "2023-10-11T18:07:00.382454Z"
    },
    "papermill": {
