     "end_time": "2023-10-11T18:07:00.386688",
     "exception": false,
     "start_time": "2023-10-11T18:07:00.351674",
     "status": "completed"
    },
    "tags": []
   },
   "outputs": [
    {
     "name": "stdout",
     "output_type": "stream",
     "text": [
      "Cluster 1 \n",
      "loc l \n",
      "\n",
      "Cluster 2 \n",
      "v.g. branchCount \n",
      "\n",
      "Cluster 3 \n",
      "ev.g. \n",
      "\n",
      "Cluster 4 \n",
      "iv.g. \n",
      "\n",
      "Cluster 5 \n",
      "n v d e b t lOCode uniq_Op total_Op total_Opnd \n",
      "\n",
