      "i uniq_Opnd \n",
      "\n",
      "Cluster 7 \n",
      "lOComment \n",
      "\n",
      "Cluster 8 \n",
      "lOBlank \n",
      "\n"
     ]
    }
   ],
   "source": [
    "# Get cluster labels\n",
    "threshold <- 0.15\n",
    "cluster_labels <- cutree(hc, h = threshold)\n",
    "\n",
    "n_clusters <-  length(unique(cluster_labels))\n",
    "\n",
    "cluster_features <- lapply(1:n_clusters, function(label) {\n",
    "  cat(\"Cluster\", label, \"\\n\")\n",
    "  \n",
    "  leaves_in_cluster <- which(cluster_labels == label)\n",
    "  features <- colnames(corr_matrix)[leaves_in_cluster]\n",
    "  cat(features, \"\\n\\n\")\n",
    "  return(features)\n",
    "})"
   ]
  },
