    "options(repr.plot.width = 12, repr.plot.height = 7)\n",
    "train %>% \n",
    "    pivot_longer(-defects, names_to = 'column') %>%\n",
    "    mutate(column = factor(column, levels = colnames(train %>% select(-\"defects\")))) %>%\n",
    "    ggplot(mapping = aes(x = value, fill = defects, color = defects)) +\n",
    "    geom_density(alpha = 0.5) + \n",
    "    facet_wrap( ~ column, scales = 'free', ncol = 4) + \n",
    "    theme(legend.position = 'bottom')"
   ]
