   "source": [
    "## Basic GAM model with no interactions\n",
    "\n",
    "We will now train a GAM with model with no interaction terms. Here is the main formula. Each `s` term in the formula indicates a potentially non-linear function of the correspoding feature. These are referred to as smoothing terms.\n",
    "\n",
    "For binary classification, the smoothing terms model the log odds of the positive class (`'True'`) versus the negative class (`'False'`)."
   ]
  },
  {
   "cell_type": "code",
   "execution_count": 15,
   "id": "582d6fee",
