   "source": [
    "form_no_int <- (\n",
    "    as.factor(defects) ~ \n",
    "    s(loc) + \n",
    "    s(v.g.) +\n",
    "    s(ev.g.) + \n",
    "    s(iv.g.) +\n",
    "    s(n) + \n",
    "    s(i) +\n",
    "    s(lOComment) + \n",
    "    s(lOBlank)   \n",
    ")"
   ]
  },
