   },
   "source": [
    "We will now fit the GAM model using the `bam` function. \n",
    "\n",
    "The summary of the model shows the approximate importance of the smoothing terms. There are two main columns of interest:\n",
    "\n",
    "1. `edf`: An edf value close to 1 indicates a linear relationship, while values away from 1 indicate a more complex relationship\n",
    "2. `Chi.sq`: The larger the value, the more important the feature is"
   ]
