   "source": [
    "options(repr.plot.width = 8, repr.plot.height = 4)\n",
    "broom::tidy(model_no_int) %>%\n",
    "    filter(p.value < 0.05) %>%\n",
    "    ggplot(mapping = aes(x = reorder(term, statistic), y = statistic)) +\n",
    "    geom_bar(stat='identity', width = 0.5) + scale_y_log10() + \n",
    "    xlab('term') + ylab('Statistic (log scale)') +\n",
    "    ggtitle('Term importance') +\n",
    "    coord_flip()\n",
    "    "
   ]
  },
