    "### Evaluating the model using 4-fold stratified cross-validation AUC\n",
    "\n",
    "We will be training GAM models with different terms in the remainder of the notebook. We will use cross-validation to select the best GAM model. See the hidden cell below for the `get_cv_auc` function thay compute the 4-fold cross-validation AUC for a GAM model formula. "
   ]
  },
  {
   "cell_type": "code",
   "execution_count": 19,
   "id": "e664d99b",
   "metadata": {
    "_kg_hide-input": true,
    "execution": {
     "iopub.execute_input": "2023-10-11T18:07:25.935138Z",
     "iopub.status.busy": "2023-10-11T18:07:25.933723Z",
     "iopub.status.idle": "2023-10-11T18:07:26.203130Z",
     "shell.execute_reply": "2023-10-11T18:07:26.201870Z"
    },
    "papermill": {
     "duration": 0.287386,
     "end_time": "2023-10-11T18:07:26.205870",
     "exception": false,
     "start_time": "2023-10-11T18:07:25.918484",
     "status": "completed"
    },
    "tags": []
   },
   "outputs": [],
   "source": [
    "# 4 repeats of 10-fold cross-validation\n",
    "set.seed(1)\n",
    "fold_train_idxs <- lapply(rsample::vfold_cv(train,v=4,repeats=1,strata=defects)$splits,'[[',2)\n",
    "\n",
    "# compute holdout log-loss for a single fold\n",
    "cv_auc_fold <- function(fold_idx,formula){\n",
    "    # train gam on training data\n",
    "    model_fold <- bam(\n",
    "        formula, data=train[fold_idx,],family='binomial'\n",
    "    )\n",
    "    \n",
    "    # generate probabilities\n",
    "    val_pred_prob <- predict(model_fold,train[-fold_idx,],type='response')\n",
    "    \n",
    "    return(MLmetrics::AUC(val_pred_prob, 1*(train$defects == 'True')[-fold_idx]))\n",
    "}\n",
    "\n",
    "# compute 4-fold CV roc-auc\n",
    "get_cv_auc <- function(formula){\n",
    "    fold_aucs <- foreach(i=fold_train_idxs) %do% cv_auc_fold(i,formula)\n",
    "    mean(as.numeric(fold_aucs))\n",
    "}\n"
   ]
  },
