   "source": [
    "options(repr.plot.width = 13.5, repr.plot.height = 4.6)\n",
    "g1 <- ggplot(train, aes(x = loc, y = lOBlank, color = defects)) + \n",
    "    geom_density_2d() + \n",
    "    theme(legend.position = 'top')\n",
    "\n",
    "g2 <- ggplot(train, aes(x = loc, y = n, color = defects)) + \n",
    "    geom_density_2d() + \n",
    "    theme(legend.position = 'top')\n",
    "\n",
    "g3 <- ggplot(train, aes(x = lOBlank, y = n, color = defects)) + \n",
    "    geom_density_2d() + \n",
    "    theme(legend.position = 'top')\n",
    "\n",
    "\n",
    "\n",
    "gridExtra::grid.arrange(g1, g2, g3, ncol = 3)"
   ]
  },
