   "source": [
    "We will not add the 3 interaction terms formula - the `ti` terms in the formula. Based on the above density plots, we should expect atleast one of the 3 terms be significant. \n",
    "\n",
    "Additionally, we will not apply smoothing to the `v.g` and `iv.g.` features and will drop the `ev.g.` term from the formula all together. In the model with no interactions terms, the effects of the former features were estimated to be linear, while the `ev.g.` feature wasn't even signficant. \n",
    "\n",
    "It turns out **all 3 interactions terms** are signficant. "
   ]
  },
