    "form_w_int <- form_no_int <- (\n",
    "    as.factor(defects) ~ \n",
    "    s(loc) + \n",
    "    v.g. +\n",
    "    iv.g. +\n",
    "    s(n) + \n",
    "    s(i) +\n",
    "    s(lOComment) + \n",
    "    s(lOBlank) + \n",
    "    ti(loc, lOBlank) +\n",
    "    ti(loc, n) +\n",
    "    ti(lOBlank, n)\n",
    ")\n",
    "model_w_int <- bam(\n",
    "    form_w_int, data = train, \n",
    "    family = 'binomial'\n",
    ")\n",
    "\n",
    "summary(model_w_int)"
   ]
